import React,{useState} from 'react'
import PropTypes from 'prop-types';
import Button from 'react-bootstrap/Button';
import Modal from 'react-bootstrap/Modal';
import './Style/ModalWindow.css'

const ModalWindow = (props) => {

  const [timerHour, setTimerHour] = useState(0)
  const [timerMin, setTimerMin] = useState(0)
  const [timerSec, setTimerSec] = useState(0)
  const [doubleClickHour, setDoubleClickHour] = useState(false)
  const [doubleClickMin, setDoubleClickMin] = useState(false)
  const [doubleClickSec, setDoubleClickSec] = useState(false)
  function changeTimerHour(e){
    let a = "";
    a = `${a}${e.target.value}`;
    if(Number(a) <= 24 && Number(a) >= 0){
      setTimerHour(e.target.value)
      a = timerHour;
    }
  }
  function changeTimerMin(e){
    let a = "";
    a = `${a}${e.target.value}`;
    if(Number(a) <= 60 && Number(a) >= 0){
      setTimerMin(e.target.value)
      a = timerMin;
    }
  }
  function changeTimerSec(e){
    let a = "";
    a = `${a}${e.target.value}`;
    if(Number(a) <= 60 && Number(a) >= 0){
      setTimerSec(e.target.value)
      a = timerSec;
    }
  }
  function closeDoubleClick(){
    // props.addTimerClick(timerHour,timerMin,timerSec)
    if(doubleClickHour == true || doubleClickMin == true ||doubleClickSec == true ){
      setDoubleClickHour(false)
      setDoubleClickMin(false)
      setDoubleClickSec(false)
    }
  }
  return (
      <Modal
        {...props}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
       >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Setting
          </Modal.Title>
        </Modal.Header >
        <Modal.Body >
          <h4>Showing time:</h4>
          <div className="modalBody-styleTime">
            <div className="pmStyleTime" onClick={()=> props.choiceStyleTime("am")} style={{color: props.color}}>{props.timeAm}</div>
            <div className="amStyleTime" onClick={()=> props.choiceStyleTime("pm")} style={{color: props.color}}>{props.timePm}</div>
          </div>
          <h4>Colors:</h4>
          <div className="modalBody-color">
            {props.stateColors.map(c => <div key={c.id} className="color" style={{background: c.style}} onClick={()=>props.colorsSetClick(c.style)}></div>)}
          </div>
          <div className="option-Timer">
            <p className={props.optionTimer == "Timer" ? "active-optionTimer" : "deactivate -optionTimer"} onClick={()=> props.optionTimerClick('Timer')}>Timer</p>
            <p className={props.optionTimer == "Time" ? "active-optionTimer" : "deactivate -optionTimer"} onClick={()=> props.optionTimerClick('Time')}>Time</p>
          </div>
          <div className="Timer-box" >
            <div className="Timer-box-inp" onClick={null}>
              <p onDoubleClick={()=>setDoubleClickHour(true)}>{doubleClickHour == true ? <input type="number"value={timerHour} onChange={changeTimerHour} max="24" min="0" /> : timerHour}</p>:
              <p onDoubleClick={()=>setDoubleClickMin(true)}>{doubleClickHour == true ? <input type="number"value={timerMin} onChange={changeTimerMin} max="60" min="0" /> : timerMin}</p>:
              <p onDoubleClick={()=>setDoubleClickSec(true)}>{doubleClickHour == true ? <input type="number"value={timerSec} onChange={changeTimerSec} max="60" min="0" /> : timerSec}</p>
            </div>
            <div className="Timer-box-btn"><button onClick={closeDoubleClick}>Add timer</button></div>
          </div>
        </Modal.Body>
        <Modal.Footer>
          <Button onClick={props.onHide}>Close</Button>
        </Modal.Footer>
      </Modal>
  )
}

export default ModalWindow;
